Please never underestimate the power of being thrifty! Just because it isn't new, doesn't mean it can't work for you! A lot of my followers, you may be new into art - and if you don't know if it's your passion yet, I  highly recommend you don't buy new if you can find some used! 

All this stuff plus two large sketch pads I scored off the local buy and sell. A very nice lady sold me the lot when I just went there for a few items! It is a reasonable deal that I can pass onto students in the future - since I'm determined to teach very soon! If not students, I share supplies with my art friends @maggiemylow
